import React from "react";

const Home = () => {
  return (
    <section className="min-h-[85vh] flex items-center justify-center px-6 md:px-10 lg:px-20 text-center">
      <div className="max-w-3xl">
        <h1 className="text-4xl md:text-5xl font-semibold leading-tight text-neutral-900 mb-4">
          We create brands and websites that empower you to grow.
        </h1>
        <p className="text-neutral-600 text-lg mb-8">
          Mirror is a branding and webflow agency for digital businesses that want to launch fast and look sharp.
        </p>
        <a
          href="#"
          className="inline-block bg-neutral-900 text-white py-3 px-6 text-sm font-medium tracking-wide hover:bg-neutral-700 transition"
        >
          Start a Project
        </a>
      </div>
    </section>
  );
};

export default Home;
